//Works like the Card.js
import "./App.css";
import EventsList from "EventsList";
function Card({ eventLists, handleEventDelete }) {
  const eventDrawn = eventLists.map((e) => {
    return (
      <EventsList
        key={e.id}
        title={e.title}
        location={e.location_id}
        time={e.time}
        date={e.date}
        planner={e.planner}
        handleEventDelete={handleEventDelete}
      />
    );
  });

  return <div className="eigth">{eventDrawn}</div>;
}

export default Card;
